			// }
			const requestOptions = {
				method: 'POST',
				headers: {
					'Authorization': 'Bearer ' + token
				},
				body: JSON.stringify({
					lastName: "Catamin",
					firstName: "Jane Elizabeth",
					middleName: "Cutamora",
					dateOfBirth: "2013-06-18",
					placeOfBirth: "Manila",
					gender: "Female",
					permanentAddress: "9 Gold St., Villa Segunda Homes, Pantoc, Meycauayan, Bulacan",
					presentAddress: "9 Gold St., Villa Segunda Homes, Pantoc, Meycauayan, Bulacan",
					mobile: "09228195773",
					landline: "83539084",
					email: "jane@bulacan.ph",
					civilStatus: "Single",
					religion: "Baptist",
					emergencyContactPerson: "Loloy Catamin",
					emergencyContactNumber: "09228195771"
				})
			}
			try {
				let response = await fetch("https://sp-api-test.alun.app/api/faculty/basic-info/add/personal", requestOptions)
				response = response.json()
				/*axios.post("https://sp-api-test.alun.app/api/faculty/basic-info/add/personal", {
					lastName: "Catamin",
					firstName: "Jane Elizabeth",
					middleName: "Cutamora",
					dateOfBirth: "2013-06-18",
					placeOfBirth: "Manila",
					gender: "Female",
					permanentAddress: "9 Gold St., Villa Segunda Homes, Pantoc, Meycauayan, Bulacan",
					presentAddress: "9 Gold St., Villa Segunda Homes, Pantoc, Meycauayan, Bulacan",
					mobile: "09228195773",
					landline: "83539084",
					email: "jane@bulacan.ph",
					civilStatus: "Single",
					religion: "Baptist",
					emergencyContactPerson: "Loloy Catamin",
					emergencyContactNumber: "09228195771"
				}, {
					headers: {
						Authorization: `Bearer ${token}`
					}
				})*/
				if (response.data.success) {
					console.log(response)
					return response.data
				} else {
					console.error(response.message)
					return response.data
				}
			} catch (err) {
				console.error(err)
				return err
			}
		}
	} catch (err) {
		console.error(err)
		return err
	}
}
